import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import AppF from "./AppF";

import Item from "./Item";
//import Slider from './slider/slider'
// import Itempage from "./itempage";
// // import Header from "./header";
// import Footer from "./footer";
// import Headercomponent from "./headerComponent";
// import Home from "./home";
// import Payment from "./payment";
import * as serviceWorker from "./serviceWorker";
import Signup from "./component/signup";
import Login from "./component/login";
import App from "./App";
import { Route, Link, BrowserRouter as Router } from "react-router-dom";
import ItemComponent from "./itemComponent";
import MediaCard from "./cardForItem";
import Calender from "./Calender";
import Appointments from "./appointments";

import Owner from "./ownerProfile";
const css = `
    .my-element {
        marginTop:70px;
        list-style-type:none
    }
`;
const routing = (
  <Router>
    <div>
      <ul className="my-element">
        <style>{css}</style>
        <li>
          <Link to="/">
            <button>Home</button>
          </Link>
        </li>
        <li>
          <Link to="/AppF">
            <button>Category</button>
          </Link>
        </li>
        <li>
          <Link to="/Appointments">
            <button>Appointments</button>
          </Link>
        </li>
      </ul>
      <button>
      <Link to="/signup" id="btn1">Sign up</Link>
      </button>

      <button>
      <Link to="/login" id="btn1">Login</Link>
      </button>

      <Route exact path="/" component={App} />
      <Route path="/AppF" component={AppF} />
      <Route path="/Appointments" component={Appointments} />
      <Route path="/signup" exact strict render={
        ()=> {
          return(<Signup />)}
        }/>

      <Route path="/login" exact strict render={
        ()=> {
          return(<Login />)}
        }/> 
    </div>

  </Router>
);

 ReactDOM.render(routing, document.getElementById("root"));
// ReactDOM.render(<AppF />, document.getElementById("root"));

//ReactDOM.render(<ItemComponent />, document.getElementById("root2"));
